import React from "react";
import { Col, Container, Row } from "reactstrap";
import logo from '../../assets/images/logo.png';
import './footer.css';

const quick__links= [
    {
        path: '/home',
        display: 'Home'
    },
    {
        path: '/about',
        display: 'About Us'
    },
    {
        path: '/tours',
        display: 'Tours'
    },
];

const quick__links2= [
    {
        path: '/gallery',
        display: 'Gallery'
    },
    {
        path: '/login',
        display: 'Login'
    },
    {
        path: '/register',
        display: 'Register'
    },
];

const Footer = () => {
    return <footer className="footer">
        <Container>
            <Row>
                <Col lg='3'>
                    <img src={logo} alt="" />
                    <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. 
                      </p>

                </Col>
            </Row>
        </Container>
    </footer>
};

export default Footer;
